import React from 'react'
import { BtnPrimary } from '../buttons/BtnPrimary'

export const Navbar = () => {
  return (
    <nav>
      <Link to="/auth/Login">Login</Link>
      <BtnSecondary navigateTo="/auth/login" />
      <BtnPrimary navigateTo="/auth/register" />
    </nav>
  )
}
